    LDC (String) "How to store timezones in the database by default<br>for properties of type `OffsetDateTime` and `ZonedDateTime`.<p>This default may be overridden on a per-property basis using `@TimeZoneStorage`.<p>NOTE: Properties of type `OffsetTime` are https://hibernate.atlassian.net/browse/HHH-16287[not affected by this<br>setting].<p>`default`::<br>Equivalent to `native` if supported, `normalize-utc` otherwise.<br>`auto`::<br>Equivalent to `native` if supported, `column` otherwise.<br>`native`::<br>Stores the timestamp and timezone in a column of type `timestamp with time zone`.<br>+<br>Only available on some databases/dialects;<br>if not supported, an exception will be thrown during static initialization.<br>`column`::<br>Stores the timezone in a separate column next to the timestamp column.<br>+<br>Use `@TimeZoneColumn` on the relevant entity property to customize the timezone column.<br>`normalize-utc`::<br>Does not store the timezone, and loses timezone information upon persisting.<br>+<br>Instead, normalizes the value to a timestamp in the UTC timezone.<br>`normalize`::<br>Does not store the timezone, and loses timezone information upon persisting.<br>+<br>Instead, normalizes the value:<br>* upon persisting to the database, to a timestamp in the JDBC timezone<br>set through `quarkus.hibernate-orm.jdbc.timezone`,<br>or the JVM default timezone if not set.<br>* upon reading back from the database, to the JVM default timezone.<br>+<br>Use this to get the legacy behavior of Quarkus 2 / Hibernate ORM 5 or older.<p>"
