    LDC (String) "Path to a file containing the SQL statements to execute when Hibernate ORM starts.<p>The file is retrieved from the classpath resources,<br>so it must be located in the resources directory (e.g. `src/main/resources`).<p>The default value for this setting differs depending on the Quarkus launch mode:<p>* In dev and test modes, it defaults to `import.sql`.<br>  Simply add an `import.sql` file in the root of your resources directory<br>  and it will be picked up without having to set this property.<br>  Pass `no-file` to force Hibernate ORM to ignore the SQL import file.<br>* In production mode, it defaults to `no-file`.<br>  It means Hibernate ORM won't try to execute any SQL import file by default.<br>  Pass an explicit value to force Hibernate ORM to execute the SQL import file.<p>If you need different SQL statements between dev mode, test (`@QuarkusTest`) and in production, use Quarkus<br>https://quarkus.io/guides/config#configuration-profiles[configuration profiles facility].<p>[source,property]<br>.application.properties<br>----<br>%dev.quarkus.hibernate-orm.sql-load-script = import-dev.sql<br>%test.quarkus.hibernate-orm.sql-load-script = import-test.sql<br>%prod.quarkus.hibernate-orm.sql-load-script = no-file<br>----<p>[NOTE]<br>====<br>Quarkus supports `.sql` file with SQL statements or comments spread over multiple lines.<br>Each SQL statement must be terminated by a semicolon.<br>====<p>"
